            "bisqEasy.walletGuide.createWallet.content" to "Bluewallet umožňuje vytvořit několik peněženek pro různé účely. Prozatím potřebujete mít pouze jednu peněženku. Jakmile vstoupíte do Bluewallet, uvidíte zprávu, která vám navrhne přidat novou peněženku. Jakmile to uděláte, zadejte název vaší peněženky a vyberte možnost *Bitcoin* v sekci *Typ*. Všechny ostatní možnosti můžete nechat tak, jak se zobrazují, a kliknout na *Vytvořit*.\n\nKdyž přejdete k dalšímu kroku, budete seznámeni se 12 slovy. Těchto 12 slov je záloha, která vám umožní obnovit peněženku, pokud se něco stane s vaším telefonem. Napište je na kus papíru (ne digitálně) ve stejném pořadí, v jakém jsou prezentována, uschovejte tento papír bezpečně a ujistěte se, že k němu máte přístup pouze vy. Více o tom, jak zabezpečit svou peněženku, se můžete dozvědět v sekci Learn Bisq 2 věnované peněženkám a bezpečnosti.\n\nAž budete hotovi, klikněte na 'Ok, I wrote it down'.\nGratulujeme! Vytvořili jste svou peněženku! Pojďme se podívat, jak přijmout vaše bitcoiny v ní.",
