            "bisqEasy.walletGuide.download.content" to "Existuje mnoho Peněženek, které můžete použít. V této příručce vám ukážeme, jak používat Bluewallet. Bluewallet je skvělý a zároveň velmi jednoduchý, a můžete ho použít k Přijetí vašeho Bitcoinu z Bisq Easy.\n\nMůžete si stáhnout Bluewallet na svůj telefon, bez ohledu na to, zda máte zařízení Android nebo iOS. Chcete-li tak učinit, navštivte oficiální webovou stránku 'bluewallet.io'. Jakmile tam budete, klikněte na App Store nebo Google Play v závislosti na zařízení, které používáte.\n\nDůležitá poznámka: pro vaši bezpečnost se ujistěte, že aplikaci stahujete z oficiálního obchodu s aplikacemi vašeho zařízení. Oficiální aplikaci poskytuje 'Bluewallet Services, S.R.L.', a měli byste to vidět ve svém obchodě s aplikacemi. Stahování škodlivé Peněženky by mohlo ohrozit vaše prostředky.\n\nNakonec rychlá poznámka: Bisq není s Bluewallet nijak spojen. Doporučujeme používat Bluewallet kvůli jeho kvalitě a jednoduchosti, ale na trhu existuje mnoho dalších možností. Měli byste se cítit naprosto svobodně porovnat, vyzkoušet a vybrat si jakoukoli Peněženku, která nejlépe vyhovuje vašim potřebám.",
