            "reputation.accountAge.score.info" to "Import 'stáří účtu' je považován za poměrně slabou formu reputace, která je reprezentována nízkým faktorem váhy.\nPro výpočet skóre je stanovena horní hranice 2000 dnů.",
            "reputation.reputationScore.intro" to "V této části je vysvětlena Reputace Bisq, abyste mohli činit informovaná rozhodnutí při přijímání nabídky.",
            "user.bondedRoles.registration.bondHolderName" to "Uživatelské jméno držitele vkladu",
            "user.bondedRoles.type.SEED_NODE.about.info" to "Seed node poskytuje síťové adresy účastníků sítě pro spuštění Bisq 2 P2P sítě.\nTo je zásadní na samém začátku, protože v tu chvíli nový uživatel ještě nemá žádná trvalá data pro připojení k ostatním uzlům.\nPoskytuje také síťová data P2P, jako jsou chatové zprávy, nově připojenému uživateli. Tuto službu doručování dat provádí také jakýkoli jiný síťový uzel, ale seed nody mají 24/7 dostupnost a vysokou úroveň kvality služby, což zajišťuje větší stabilitu a výkonnost a tím i lepší zkušenost s inicializací.\nOperátoři seed nodů z Bisq 1 mohou bez zajištění nového BSQ vkladu stát se operátory seed nodů v Bisq 2.",
