            "reputation.bond.info2" to "Doba uzamčení musí být nejméně 50 000 bloků, což je přibližně 1 rok, aby byl vklad považován za platný. Částka může být vybrána uživatelem a bude určovat pořadí vůči ostatním prodejcům. Prodejci s nejvyšším skóre reputace budou mít lepší obchodní příležitosti a mohou získat vyšší prémii na cenu. Nejlepší nabídky podle reputace budou v nabídce výběru nabídek ve \"Průvodci obchodem\".\n\nKupující mohou přijímat nabídky pouze od prodejců s reputačním skóre alespoň 30 000. Toto je výchozí hodnota a může být změněno v preferencích.\n\nPokud je vytvoření BSQ vkladu příliš složité, zvažte další dostupné možnosti pro budování reputace.",
